## Remarks  
 <span data-ttu-id="1e775-102"><xref:System.ServiceModel.Configuration.WebHttpElement> は <xref:System.ServiceModel.Configuration.BehaviorExtensionElement> サブタイプであり、構成によってエンドポイントに <xref:System.ServiceModel.Description.WebHttpBehavior> を含めるために使用できます。</span><span class="sxs-lookup"><span data-stu-id="1e775-102">The <xref:System.ServiceModel.Configuration.WebHttpElement> is a <xref:System.ServiceModel.Configuration.BehaviorExtensionElement> sub-type that can be used to include the <xref:System.ServiceModel.Description.WebHttpBehavior> on an endpoint through configuration.</span></span> <span data-ttu-id="1e775-103"><xref:System.ServiceModel.Description.WebHttpBehavior>と組み合わせて使用する場合の動作、<xref:System.ServiceModel.WebHttpBinding>バインディング、Windows Communication Foundation (WCF) サービスの Web プログラミング モデルを使用します。</span><span class="sxs-lookup"><span data-stu-id="1e775-103">The <xref:System.ServiceModel.Description.WebHttpBehavior> behavior, when used in conjunction with the <xref:System.ServiceModel.WebHttpBinding> binding, enables the Web programming model for a Windows Communication Foundation (WCF) service.</span></span> <span data-ttu-id="1e775-104"><xref:System.ServiceModel.Web.WebServiceHost> は、<xref:System.ServiceModel.WebHttpBinding> を使用するエンドポイントにこの動作を自動的に追加することに注意してください。</span><span class="sxs-lookup"><span data-stu-id="1e775-104">Note that the <xref:System.ServiceModel.Web.WebServiceHost> automatically adds this behavior to endpoints that use the <xref:System.ServiceModel.WebHttpBinding>.</span></span>  
  
   
  
## Examples  
 <span data-ttu-id="1e775-105">この例では、<xref:System.ServiceModel.Configuration.WebHttpElement> 型を返します。</span><span class="sxs-lookup"><span data-stu-id="1e775-105">This sample returns the type <xref:System.ServiceModel.Configuration.WebHttpElement>.</span></span>  
  
```  
using System;  
using System.ServiceModel;  
using System.ServiceModel.Web;  
using System.ServiceModel.Configuration;  
  
    class Program  
    {  
        static void Main(string[] args)  
        {  
            WebHttpElement webHttpElement = new WebHttpElement();  
            Console.WriteLine("The type is: {0}", webHttpElement.BehaviorType);  
            Console.WriteLine("Press <ENTER> to terminate the program.");  
            Console.ReadLine();  
        }  
    }  
```

  
  
